import React from 'react';
import "./styles/Footer.css";

const footer = (props) => (

    <div className="footer">
        <a><p>Impressum</p></a>
        <a><p>Kontakt</p></a>
        <a><p>Kategorien</p></a>
    </div>
);

export default footer;
